_09_数据类型_值类型_枚举.sol.content:
// SPDX-License-Identifier:GPL-3.0

pragma solidity ^0.8.17;

contract LearnStructs {
    struct Movie {
        string title;
        string director;
        uint id;
    }
    Movie movie;

    constructor () {
        // pass param by index
        movie = Movie("xcad", "sdfa", 12);
        // pass param by name
        movie = Movie({
            title: "sdfa",
            director: "sdfa",
            id: 123
        });
    }

    function getMovie () public view returns (Movie memory) {
        return movie;
    }


    struct Tv {
        string title;
        string director;
        uint id;
        string[] maker;
        mapping(string => uint) makerAndAge;
    }
    Tv[] public tvs;
    mapping(uint => Tv) idAndTv;

    // 将一个memory的结构体赋值给storage的结构体, 实际上是浅拷贝
    function test() public {
        // 因为Tv结构体中包含了mapping, 所以实际上无法创建出Tv memory类型, 如果想要在数组或者映射中添加TV, 使用以下方式
        Tv storage tv = tvs.push();
        tv.title = "title1";
        // ... other property assingment

        Tv storage tv1 = idAndTv[4];
        tv1.title = "title2";
        // ... other property assingment
    }

    struct Array {
        string[] value;
    }
    Array a;
    function test1() public {
        Array memory a1 = Array(new string[](1));
        a1.value[0] = "zhangsan";

        a = a1;
        a1.value[0] = "lisi";
    }
    function getA() public view returns (string[] memory) {
        return a.value;
    }

}

